    [],nt"num_tags": 3,nt"name": "narrative-report-killcohook-national-wildlife-refuge-september-to-december-1956",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Killcohook National
    Wildlife Refuge outlines Refuge accomplishments from Sept to December of 1956. The
    report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, rodents, mammals, raptors, and fish- is also covered. The
    Refuge development and maintenance section discusses physical developments, plantings,
    and prescribed burning. Resource management is outlined; topics include fur harvesting
    and commercial fishing. A progress report on field investigations and applied research
    is also provided. The public relations section of the report describes Refuge visitors.
    Items of interest, photographs and N-R forms are attached.",nt"owner_org":
